00e1c s\u0129, chuy\u00ean gia v\u1ec1 c\u00e1c v\u1ea5n \u0111\u1ec1 H\u1ed7 tr\u1ee3 sinh s\u1ea3n, S\u1ea3n ph\u1ee5 khoa, Nam khoa... Qu\u00fd kh\u00e1ch s\u1ebd nh\u1eadn \u0111\u01b0\u1ee3c c\u00e1c ph\u1ea7n qu\u00e0 t\u1eeb ch\u01b0\u01a1ng tr\u00ecnh v\u00e0 c\u00f3 c\u01a1 h\u1ed9i tr\u1edf th\u00e0nh ch\u1ee7 nh\u00e2n may m\u1eafn c\u1ee7a c\u00e1c Voucher 10 tri\u1ec7u, 5 tri\u1ec7u, 3 tri\u1ec7u, 1 tri\u1ec7u s\u1eed d\u1ee5ng cho c\u00e1c d\u1ecbch v\u1ee5 c\u1ee7a B\u1ec7nh vi\u1ec7n th\u00f4ng qua ch\u01b0\u01a1ng tr\u00ecnh b\u1ed1c th\u0103m may m\u1eafn. \ud83c\udf3a\n\n\ud83d\udce9 M\u1ecdi th\u1eafc m\u1eafc li\u00ean quan \u0111\u1ebfn T\u1ecda \u0111\u00e0m, Qu\u00fd kh\u00e1ch li\u00ean h\u1ec7 t\u1edbi Fanpage B\u1ec7nh vi\u1ec7n \u0111\u1ec3 \u0111\u01b0\u1ee3c k\u1ebft n\u1ed1i t\u01b0 v\u1ea5n.\n---------------\nB\u1ec7nh vi\u1ec7n Nam h\u1ecdc v\u00e0 Hi\u1ebfm mu\u1ed9n H\u00e0 N\u1ed9i\nAndrology and Fertility Hospital of Hanoi\n\ud83c\udf1f B\u1ec7nh vi\u1ec7n \u0111\u1ea1t chu\u1ea9n ch\u1ea5t l\u01b0\u1ee3ng qu\u1ed1c t\u1ebf trong H\u1ed7 tr\u1ee3 sinh s\u1ea3n (RTAC)\n---------------\n\ud83d\udcde 024 3634 3636 | 090 222 1268 (24\/7)\n\ud83c\udfe5 431 Tam Trinh, Ho\u00e0ng Mai, H\u00e0 N\u1ed9i.\n\u270f Website: dongynguyenhuutoan \n\ud83d\udc49 Fanpage: facebook.com\/afhanoi\n\ud83c\udfb6 Tiktok: tiktok.com\/\u0040afhanoi\n\ud83d\udcf9 Youtube: youtube.com\/\u0040afhanoichannel\n\ud83d\udde8\ufe0f \u201cK\u1ebft n\u1ed1i y\u00eau th\u01b0\u01a1ng, \u01af\u01a1m m\u1ea7m h\u1ea1nh ph\u00fac!\u201d\n---------------\n\u23f3 Th\u1ee9 2 \u2013 Th\u1ee9 7:\n\ud83d\udd39 S\u00e1ng: 7h30 \u2013 12h00; Chi\u1ec1u: 13h30 - 17h00\n\u23f3 Ch\u1ee7 nh\u1eadt:\n\ud83d\udd39 S\u00e1ng: 7h30 \u2013 12h00; Chi\u1ec1u: Ngh\u1ec9"},"message_truncation_line_limit":null,"sponsored_data":null,"attachments":[{"action_links":[{"__typename":"LinkOpenActionLink","url":"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fdocs.google.com\u00252F \u1edbi m\u1ee5c \u0111\u00edch chia s\u1ebb nh\u1eefng th\u00f4ng tin h\u1eefu \u00edch trong l\u0129nh v\u1ef1c h\u1ed7 tr\u1ee3 sinh s\u1ea3n, s\u1ea3n ph\u1ee5 khoa v\u00e0 nam khoa, gi\u00fap c\u00e1c gia \u0111\u00ecnh \u0111ang tr\u00ean h\u00e0nh tr\u00ecnh t\u00ecm ki\u1ebfm con y\u00eau \u0111\u00f3n con kh\u1ecfe m\u1ea1nh v\u1ec1 nh\u00e0. \n\n\u2728 T\u1ecda \u0111\u00e0m ch\u01b0\u01a1ng tr\u00ecnh \u201cCLB T\u00ecm con y\u00eau\u201d s\u1ed1 74 l\u00e0 c\u01a1 h\u1ed9i \u0111\u1ec3 c\u00e1c c\u1eb7p v\u1ee3 ch\u1ed3ng c\u00f3 c\u01a1 h\u1ed9i g\u1eb7p g\u1ee1, tr\u00f2 chuy\u1ec7n tr\u1ef1c ti\u1ebfp v\u1edbi Chuy\u00ean gia, B\u00e1c s\u0129 c\u1ee7a B\u1ec7nh vi\u1ec7n Nam h\u1ecdc v\u00e0 Hi\u1ebfm mu\u1ed9n H\u00e0 N\u1ed9i:\n\n1\ufe0f\u20e3. BS CKI Ph\u1ea1m V\u0103n H\u01b0\u1edfng, Ph\u00f3 Gi\u00e1m \u0111\u1ed1c chuy\u00ean m\u00f4n B\u1ec7nh vi\u1ec7n.\n2\ufe0f\u20e3. ThS. BS Tr\u1ecbnh Th\u1ecb Th\u00fay, Ph\u00f3 Tr\u01b0\u1edfng khoa Ph\u1eabu thu\u1eadt - G\u00e2y m\u00ea h\u1ed3i s\u1ee9c.\n\nNgo\u00e0i vi\u1ec7c tham gia \u0111\u1eb7t c\u00e2u h\u1ecfi, trao \u0111\u1ed5i, t\u01b0 v\u1ea5n c\u00f9ng v\u1edbi B\u00e1c s\u0129, chuy\u00ean gia v\u1ec1 c\u00e1c v\u1ea5n \u0111\u1ec1 H\u1ed7 tr\u1ee3 sinh s\u1ea3n, S\u1ea3n ph\u1ee5 khoa, Nam khoa... Qu\u00fd kh\u00e1ch s\u1ebd nh\u1eadn \u0111\u01b0\u1ee3c c\u00e1c ph\u1ea7n qu\u00e0 t\u1eeb ch\u01b0\u01a1ng tr\u00ecnh v\u00e0 c\u00f3 c\u01a1 h\u1ed9i tr\u1edf th\u00e0nh ch\u1ee7 nh\u00e2n may m\u1eafn c\u1ee7a c\u00e1c Voucher 10 tri\u1ec7u, 5 tri\u1ec7u, 3 tri\u1ec7u, 1 tri\u1ec7u s\u1eed d\u1ee5ng cho c\u00e1c d\u1ecbch v\u1ee5 c\u1ee7a B\u1ec7nh vi\u1ec7n th\u00f4ng qua ch\u01b0\u01a1ng tr\u00ecnh b\u1ed1c th\u0103m may m\u1eafn. \ud83c\udf3a\n\n\ud83d\udce9 M\u1ecdi th\u1eafc m\u1eafc li\u00ean quan \u0111\u1ebfn T\u1ecda \u0111\u00e0m, Qu\u00fd kh\u00e1ch li\u00ean h\u1ec7 t\u1edbi Fanpage B\u1ec7nh vi\u1ec7n \u0111\u1ec3 \u0111\u01b0\u1ee3c k\u1ebft n\u1ed1i t\u01b0 v\u1ea5n.\n---------------\nB\u1ec7nh vi\u1ec7n Nam h\u1ecdc v\u00e0 Hi\u1ebfm mu\u1ed9n H\u00e0 N\u1ed9i\nAndrology and Fertility Hospital of Hanoi\n\ud83c\udf1f B\u1ec7nh vi\u1ec7n \u0111\u1ea1t chu\u1ea9n ch\u1ea5t l\u01b0\u1ee3ng qu\u1ed1c t\u1ebf trong H\u1ed7 tr\u1ee3 sinh s\u1ea3n (RTAC)\n---------------\n\ud83d\udcde 024 3634 3636 | 090 222 1268 (24\/7)\n\ud83c\udfe5 431 Tam Trinh, Ho\u00e0ng Mai, H\u00e0 N\u1ed9i.\n\u270f Website: dongynguyenhuutoan \n\ud83d\udc49 Fanpage: facebook.com\/afhanoi\n\ud83c\udfb6 Tiktok: tiktok.com\/\u0040afhanoi\n\ud83d\udcf9 Youtube: youtube.com\/\u0040afhanoichannel\n\ud83d\udde8\ufe0f \u201cK\u1ebft n\u1ed1i y\u00eau th\u01b0\u01a1ng, \u01af\u01a1m m\u1ea7m h\u1ea1nh ph\u00fac!\u201d\n---------------\n\u23f3 Th\u1ee9 2 \u2013 Th\u1ee9 7:\n\ud83d\udd39 S\u00e1ng: 7h30 \u2013 12h00; Chi\u1ec1u: 13h30 - 17h00\n\u23f3 Ch\u1ee7 nh\u1eadt:\n\ud83d\udd39 S\u00e1ng: 7h30 \u2013 12h00; Chi\u1ec1u: Ngh\u1ec9"},"ghl_mocked_encrypted_link":null,"ghl_label_mocked_cta_button":null,"wwwURL":"https:\/\/www.facebook.com\/afhanoi\/posts\/pfbid0DSvn62PDR4zz2Qy5mVGaFw8g9MHWv7Kv4XsJrKCEYqGekkyYzpZjUD9TfWpnvfV8l","target_group":null,"attached_story":null,"id":"UzpfSTEwMDA2NDY1NjAxMDgwMToxMTM4Mzc2ODU0OTk0MTcxOjExMzgzNzY4NTQ5OTQxNzE="},"__module_operation_CometFeedStoryContentMatchRenderer_story":{"__dr":"CometFeedStoryDefaultContentStrategy_content$normalization.graphql"},"__module_component_CometFeedStoryContentMatchRenderer_story":{"__dr":"CometFeedStoryDefaultContentStrategy.react"}},"layout":{"__typename":"CometStoryDefaultLayoutStrategy","__isICometStorySection":"CometStoryDefaultLayoutStrategy","is_prod_eligible":true,"__module_operation_CometFeedStoryLayoutMatchRenderer_story":{"__dr":"CometFeedStoryDefaultLayoutStrategy_layout$normalization.graphql"},"__module_component_CometFeedStoryLayoutMatchRenderer_story":{"__dr":"CometFeedStoryDefaultLayoutStrategy.react"}},"copyright_violation_header":null,"header":null,"context_layout":{"__typename":"CometFeedSt
